import React from 'react';
import results from './results';

const Result = () => {
    console.log(results[0].show.image.medium)
    return (
        <ul>
            {results.map((movie)=>{
                <li key={movie.show.id}>{movie.show.id}</li>
            })}


            <h3>hi</h3>
            <img src={results[0].show.image.medium}/>

        </ul>
    ); 
};

export default Result;
